import { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return(
    <div className="App">
      <header className="App-header">

        <p>
          Hello
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}
}

export default App;
